import React from 'react';
import {
    VictoryBar,
    VictoryChart,
    VictoryLine,
    VictoryPie,
  } from "victory";

const UserDetails = ({user}) => {
    return(
        <VictoryChart>
            <VictoryBar
                data={[
                { x: "lizard", y: 21 },
                { x: "snake", y: 20 },
                { x: "crocodile", y: 26 },
                { x: "alligator", y: 90 },
                ]}
            />
        </VictoryChart>
    )
}
export default UserDetails;
